import React from 'react';

const Nav = () => {
    return (
        <>
            <div id="navBar">
                <div className="man">
                    <ul>
                        <li>Home</li>
                        <li>Services</li>
                        <li>About</li>
                        <li>Contact</li>
                    </ul>
                    </div>
                </div>
        </>
    )
}

export default Nav;
